import React from 'react';

class MessageList extends React.Component {
  listMessages = () => {
      return this.props.messages.map(message => <detail key={message.id} detail={message.detail}/>)
  }

  render() {
    return (
      <div>
        {MessagesList()}
      </div>
    )
  }
}

export default MessageList;
